import styled from "styled-components";

type ButtonType = {
	buttonTitle: string;
	link?: string;
};

export function Button({buttonTitle, link}: ButtonType) {
	return <StyledButton><a href={link}></a>{buttonTitle}</StyledButton>;
}

const StyledButton = styled.button`
	border: 2px solid orange;
	background-color: transparent;
`;
